import React from "react";

export default function TodoList() {
  return (
    <div className="igniteMain">
      <div className="header">
        <form>
          <input placeholder="search for ideas..."></input>
          <button type="submit">Ignite!</button>
        </form>
      </div>
    </div>
  );
}
